import React, { useState, useEffect } from 'react'
import Papa from 'papaparse';
import { csv } from 'd3';
// import csv from '../../../public/alkoholilupa_toimipaikkatiedot_34.csv'
export default function TableCsv() {
  const [rows, setRows] = useState<any>([]);
  const [data, setData] = useState<any>([]);

  const csvJSON = (csv: any) => {
    var lines = csv.split("\n");
    var result: any[] = [];
    var headers: any = lines[0]
      .split(";")
      .join(",")
      .split(",");
    var parse_header: any = lines[0]
      .split(";")
      .join(",")
      .split(",");
    lines[0]
      .split(";")
      .join(",")
      .split(",")
      .forEach((key: any) => {
        lines.sortOrders[key] = 1;
      });

    lines.map((line: any, indexLine: number) => {
      if (indexLine < 1) return; // Jump header line

      var obj: any = {};
      var currentLine = line
        .split(";")
        .join(",")
        .split(",");

      headers.map((header: any, indexHeader: number) => {
        obj[header] = currentLine[indexHeader];
      });

      result.push(obj);
    });

    result.pop(); // remove the last item because undefined values

    return result; // JavaScript object
  }

  useEffect(() => {
    const url: any = '/alkoholilupa_toimipaikkatiedot_34.csv';
    csv(url).then((data: any) => {
      console.log("DATA CSV", data);
      setData(data)
    });

    // const res: any[] = csvJSON(data)
    // console.log('===> ', res);
    // function useCsvData(url: any) {
    //   const res: any = Papa.parse(url, {
    //     download: true,
    //     header: true,
    //     complete: function (results) {
    //       setRows(results.data);
    //     }
    //   })
    //   console.log(res);
    // }
    // // useCsvData(url);
    // console.log("PARSE ", rows);
  }, [])


  return (
    <div className="card ">
      <div className="card-header">
        <h4 className="card-title"> Simple Table</h4>
      </div>
      <div className="card-body">
        <div className="table-responsive">
          <table className="table tablesorter " id="">
            <thead className=" text-primary">
              <tr>
                <th>Name</th>
                <th>Country</th>
                <th>City</th>
                <th className="text-center">Salary</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Dakota Rice</td>
                <td>Niger</td>
                <td>Oud-Turnhout</td>
                <td className="text-center">$36,738</td>
              </tr>
              <tr>
                <td>Minerva Hooper</td>
                <td>Curaçao</td>
                <td>Sinaai-Waas</td>
                <td className="text-center">$23,789</td>
              </tr>
              <tr>
                <td>Sage Rodriguez</td>
                <td>Netherlands</td>
                <td>Baileux</td>
                <td className="text-center">$56,142</td>
              </tr>
              <tr>
                <td>Philip Chaney</td>
                <td>Korea, South</td>
                <td>Overland Park</td>
                <td className="text-center">$38,735</td>
              </tr>
              <tr>
                <td>Doris Greene</td>
                <td>Malawi</td>
                <td>Feldkirchen in Kärnten</td>
                <td className="text-center">$63,542</td>
              </tr>
              <tr>
                <td>Mason Porter</td>
                <td>Chile</td>
                <td>Gloucester</td>
                <td className="text-center">$78,615</td>
              </tr>
              <tr>
                <td>Jon Porter</td>
                <td>Portugal</td>
                <td>Gloucester</td>
                <td className="text-center">$98,615</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  )
}
